import React, {useState} from 'react'
import { Link } from 'react-router-dom'

function Page3() {
  return (
    <div className='slide-section about-section'>
    <h1>Our Team</h1>
    <p style={{fontSize: "120%"}}>We help storage owners get the most money and pay the least taxes when selling their self-storage business. We are a community of self-storage owners, built by owners. We want to share knowledge, information, and tools to help you make the best decisions when selling your self-storage business. </p>
    
  </div>
  )
}

export default Page3
